import React, { Component } from 'react';
import './App.css';

let API_KEY = process.env.REACT_APP_WEATHER_API_KEY;
console.log(API_KEY);
class App extends Component {
  constructor() {
    super()
  }

  componentDidMount() {
    fetch(`http://api.openweathermap.org/data/2.5/weather?zip=94040,usAPPID=${API_KEY}`)
    .then(response => response.json())
    .then(data => {
      console.log(data)
      return data;
    })
    .catch(error => error.message)
  }

  render() {
    return (
      <div className="App">
      </div>
    );
  }
}

export default App;
